import { 
	Grid,
	Card,
	Typography,
	CardContent,
	TextField,
	Button
} from '@mui/material'

export default function UserForm() {
	return (
		<Grid container 
			  direction="column"
			  alignItems="center"
			  justifyContent="center"
			  >
			<Grid item xs={3}>
				<Card 
				 sx={{mt:5}}
				 style={{
				 	backgroundColor:'#1e272e',
				 	padding:'1rem'
				 }}
				>
					<Typography 
						variant='filled'
						textAlign='center'
						color='white'
						>
						Create User
					</Typography>
					<CardContent>
						<form>
							<TextField 
								variant='filled'
								label='Nombre'
								sx={{
									display:'block',
									margin:'.5rem 0'
								}}
								inputProps={{style:{color:'white'}}}
								InputLabelProps={{style:{color:'white'}}}
							/>
							<TextField 
								variant='filled'
								label='Email'
								sx={{
									display:'block',
									margin:'.5rem 0'
								}}
								inputProps={{style:{color:'white'}}}
								InputLabelProps={{style:{color:'white'}}}
							/>
							<TextField 
								variant='filled'
								label='Password'
								sx={{
									display:'block',
									margin:'.5rem 0'
								}}
								inputProps={{style:{color:'white'}}}
								InputLabelProps={{style:{color:'white'}}} 	
							/>
							<Button 
								variant='contained'
								color='primary'
								type='submit'  
								>
								Guardar
							</Button>
						</form>
					</CardContent>
				</Card>
			</Grid>
		</Grid>
	)
}
